import React from 'react'

import PostListItem from '../post-list-item/post-list-item';

const PostList = ({label}) => {
    return (
        <ul>
            <PostListItem label='leeee'/>
            <PostListItem label='qqqqq'/>
            <PostListItem label='ddddd'/>
        </ul>
    )
}

export default PostList
